children.name:
Step implementation missing for "I access facebook page registration Sucessfully".

We tried searching for files containing step definitions using the following search pattern templates:

  - cypress\e2e\cucumber/[filepath]/**/*.{js,mjs,ts,tsx}
  - cypress\e2e\cucumber/[filepath].{js,mjs,ts,tsx}
  - cypress/support/step_definitions/**/*.{js,mjs,ts,tsx}

These templates resolved to the following search patterns:

  - cypress\e2e\cucumber\examples\**\*.{js,mjs,ts,tsx}
  - cypress\e2e\cucumber\examples.{js,mjs,ts,tsx}
  - cypress\support\step_definitions\**\*.{js,mjs,ts,tsx}

These patterns matched the following files:

  - cypress\e2e\cucumber\examples\steps.js

However, none of these files contained a step definition matching "I access facebook page registration Sucessfully".
